import React from 'react';
import logo from '../assets/logo.jpeg';
import '../styles/App.css';

export default function App() {
  return (
    <div className="App">

<h2>Epigreen-SIRIUS ING2</h2>
        <p>Étudiant 1 : Shin Seulgi <br/>
            US1 : Mise en place de l'algorithme du moteur de recherche.</p>
        <p>Étudiant 2 : Ghazal Nawel <br/>
            US1 : Calcul des émissions carbone générées par les modes de livraison. </p>
        <p>Étudiant 3 : Haj Abouda Nawres <br/>
            US1 : Mise en place d'un algorithme qui calcule les émisisons carbone des trajets effectués<br/>
            durant le processus de fabrication du produit.</p>
    </div>
  );
}
